British fitness wrestler Bethany Storm is a huge muscular, 185 cm tall, pumped blonde woman. She has a vast arsenal of holds, amazing energy and loads of power! The opponent Eri is a cute Japanese schoolgirl, quite strong for her size and capable of giving her class mates a good match. The problem is that Bethany is way much bigger than anything Eri has wrestled. Eri?s slim teenage torso offer little protection against Bethany?s huge fists. Each belly punch causes Eri to double over and drop to her knees. Amused by Eri?s struggles to recover her air, Bethany enjoys the situation and flexes her muscles. Eri is always within reach from Bethany?s tall strong legs, and is kicked in head, gut, groin and shin. She weights just a mere 50 kg/110 lbs, so Bethany can easily toss her around. Bethany finishes her with a strong belly punch that knocks her out. Bethany Storm?s sister is the promising wrestling and bellypunching superstar Sonja Storm. 
